    // 
    window.helper = {
        // 
        async waitElementVisible(visibleTag, fun) {
            let node = jq(visibleTag)
            if (node === null || node.is(":visible") === false) {
                setTimeout(() => {
                    helper.waitElementVisible(visibleTag, fun)
                }, 100)
            } else {
                await helper.sleep(500)
                fun()
            }
        },
        // 
        closeWindow() {
            window.open('', '_self')
            window.close()
        },
        // 
        reloadWindow() {
            window.location.reload()
        },
        // 
        sleep(duration) {
            return new Promise(resolve => {
                setTimeout(resolve, duration)
            })
        },
        // 
        keyboardInput(dom, value) {
            let evt = document.createEvent('HTMLEvents')
            evt.initEvent('input', true, true)
            dom.value = value
            dom.dispatchEvent(evt)
        },
        // 
        clickUpAndDown(el, evtType, keyCode) {
            let evtObj;
            const win = document.defaultView;
            if (document.createEvent) {
                if (win.KeyEvent) {//firefox 
                    evtObj = document.createEvent('KeyEvents');
                    evtObj.initKeyEvent(evtType, true, true, win, true, false, false, false, keyCode, 0);
                } else {//chrome 
                    evtObj = document.createEvent('UIEvents');
                    evtObj.initUIEvent(evtType, true, true, win, 1);
                    delete evtObj.keyCode;
                    if (typeof evtObj.keyCode === "undefined") {//keycode
                        Object.defineProperty(evtObj, "keyCode", {value: keyCode});
                    } else {
                        evtObj.key = String.fromCharCode(keyCode);
                    }
                }
                el.dispatchEvent(evtObj);
            } else if (document.createEventObject) {//IE 
                evtObj = document.createEventObject();
                evtObj.keyCode = keyCode
                el.fireEvent('on' + evtType, evtObj);
            }
        }
    };
